import React from 'react'
import "../../CSS/Userdashboard/Statistics.css"
import {Helmet} from "react-helmet";

function Statistics() {
  return (
    <div className="statistics-page" >
<h2 id="statistics-page-title">
    Statistics
</h2>

<Helmet>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/Chart.js/2.5.0/Chart.min.js"  type="text/javascript" />
            </Helmet>




    </div>
  )
}

export default Statistics
